  render() {
    const { randNum } = this.props;
    // console.log(this.props.randNum[1]);
    return (
      <div>
        <h1> {this.props.title} </h1>
        <p className="ball">{randNum[0]}</p>
        <h2>Lottery Component</h2>
      </div>
    );
  }
}

export default LottoBall;

